import React, { Component, useEffect, useState } from 'react'
import axios from 'axios';
const Orderdetail=(props)=>{
    // console.log(props.location.state.resnumber,'lklklklkl')
   const[reciverdata,setreciverdata]=useState('');
   const[buydata,setbuydata]=useState('');
    useEffect(()=>{
        axios.get(`http://localhost:3000/admin/ordersdetail/${props.location.state.resnumber}`, { 
        }).then((response)=>{
   console.log(response.data[1],'ccccc')
   setreciverdata(response.data[0][0])
   setbuydata(response.data[1])
        })
    },[])
    return(
        <div className="mainor">
        {buydata.map((data)=>
               <text style={{textAlign:'center',color:'black'}}>{data[0]}</text> 
        )}
       </div>
    )
}
export default Orderdetail;
